import React from "react";
import { styles } from "./Header.module.scss";
export function Header() {
  return (
    <header className="page_header">
      <div className="content">
        <ul className="header__navig">
          <li className={`${styles.HeaderItems} ${styles.HeaderLogo}`}></li>
          <li className={`${styles.HeaderItems} ${styles.HeaderSearch}`}></li>
          <li className={`${styles.HeaderItems} ${styles.HeaderNotifications}`}></li>
          <li className={`${styles.HeaderItems} ${styles.HeaderAudio}`}></li>
          <li className={`${styles.HeaderItems} ${styles.HeaderProf}`}></li>
          <img src="/public/vkLogo.svg" alt="logo" />
        </ul>
      </div>
    </header>
  );
}
